import AuthProvider from "./context/auth";
import './App.css';
import Navbar from './components/Navbar/Navbar'

function App() {
  const theme = false;
  return (
    <AuthProvider>
      <div className="App">
        <Navbar dark={ theme }/>
      </div>
    </AuthProvider>
  );
}

export default App;
